import React from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import { IconButton } from "@mui/material";
import { Visibility } from "@mui/icons-material";
import { VisibilityOff } from "@mui/icons-material";
import { FormControl } from "@mui/material";
import { InputLabel } from "@mui/material";
import { OutlinedInput } from "@mui/material";
import { InputAdornment } from "@mui/material";
import {Divider} from "@mui/material";

export default function SignUp() {
  const [showPassword, setShowPassword] = React.useState(false);

  const handleClickShowPassword = () => setShowPassword((show) => !show);

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };
  return (
    <div>
      <Box 
      component="form"
      sx={{
      height:380,
      width:500,
      my:20,
      mx:100,
      display:"flex",
      flexDirection:"column",
      alignItems:"center",
      justifyContent:"",
      border: '2px solid grey',
      borderRadius:'20px',
      bgcolor:'#cfd8dc' }}>
        <div>
        <FormControl sx={{ m: 1, width: "50ch" }}>
          <TextField
            id="outlined-email-input"
            label="Mobile number or Email Address"
          />
        </FormControl>
        <FormControl sx={{ m: 1, width: "50ch" }} variant="outlined">
          <InputLabel htmlFor="outlined-adornment-password">
            Password
          </InputLabel>
          <OutlinedInput
            id="outlined-adornment-password"
            type={showPassword ? "text" : "password"}
            endAdornment={
              <InputAdornment position="end">
                <IconButton
                  aria-label="toggle password visibility"
                  onClick={handleClickShowPassword}
                  onMouseDown={handleMouseDownPassword}
                  edge="end"
                >
                  {showPassword ? <VisibilityOff /> : <Visibility />}
                </IconButton>
              </InputAdornment>
            }
            label="Password"
          />
        </FormControl>
        <Button variant="contained" sx={{ m: 2, width: "50ch",borderRadius:'20px' }}>
          Login
        </Button>
        <a style={{display:"flex",justifyContent:"center",alignItems:"flex-start", color:'blue',marginBottom:'10px'}}>Forgot Password?</a>
          <Divider></Divider>
        <Button variant="contained" sx={{ m: 2, width: "50ch",borderRadius:'20px',bgcolor:'#81c784' }}>
          Create New Account
        </Button>
        </div>
      </Box>
    </div>
  );
}
